    if not rem:
        return None

    freq: Dict[int, int] = {}
    for s in remaining_subsets:
        for e in set(s):
            if e in rem:
                freq[e] = freq.get(e, 0) + 1

    n_rem = max(1, len(rem))
    n_total = n_rem + len({e for ss in selected_subsets for e in ss})
    progress = 1.0 - (n_rem / max(1, n_total))

    fvals = np.array(list(freq.values()), dtype=float)
    q1 = float(np.quantile(fvals, 0.33)) if fvals.size else 1.0
    q2 = float(np.quantile(fvals, 0.66)) if fvals.size else 1.0

